export const setDivVisibility = (isVisible) => ({
    type: 'SET_DIV_VISIBILITY',
    payload: isVisible,
  });
  
  export function setAuthed(authed) {
    return {
      type: 'SET_AUTHED',
      payload: authed,
    };
  }

export const logout = () => ({
  type: 'LOGOUT',
  payload: authed
})
